      "created_time": "2017-11-22T16:49:51+0000",
      "message": "For those that don't understand NN, I'll see if I can explain it in simple terms. As of right now you pay your electric company and every electrical socket in your house provides the same amount of energy. So an electrical socket can provide electricity for a TV, cable box, blender, saw, and it will function. Now let's say the electric company wants to charge you according to rooms so let's say they'll sell you a basic package that will provide electricity for light bulbs and lamps throughout your house. But if you need more energy than they can sell you a living room package to power your TV cable box and stereo system now let's say you need a kitchen package to provide you with your refrigerator, blender, coffee maker, and anything else you need in the kitchen and let's say they can sell you a garage package that provides electricity to run all your equipment in a garage. By the time you add all those packages up electricity bill will be way more expensive. Net neutrality will work in the same way they can sell you a basic package that allow you to check emails but if you want more bandwidth then they can sell you a movie package or a sports package or a gaming package and your internet bill could Skyrocket. Getting rid of net neutrality is not good for the consumer but good for business",
