      "message": "Conclusion \nThe FCC‚Äôs proposed regulation of the Internet is as misunderstood as it is important to the digital revolution and the U.S. economy. Rather than a long-standing set of rules that have protected innovators, it is a recently articulated idea that threatens innovation. Rather than a tool to introduce competition in a monopoly market, it would discourage competition in what is now a dynamic marketplace.\nThese and other misconceptions obscure the lack of a compelling case for FCC regulation, and the dangers to Americans that such regulation would pose.\n‚ÄîJames L. Gattuso is Senior Research Fellow for Regulatory Policy and Michael Sargent is a Research Assistant in the Thomas A. Roe Institute for Economic Policy Studies, of the Institute for Economic Freedom and Opportunity, at The Heritage Foundation.                                                                                                           http://www.heritage.org/government-regulation/report/eight-myths-about-fcc-regulation-the-internet",
