      "created_time": "2017-11-22T11:59:15+0000",
      "message": "Boy, there are a lot of people confused in this comments section. To be clear, net neutrality currently exists and it is the regulations put in place by the Obama administration. If those regulations are removed there would no longer be net neutrality. Net neutrality simply put means that you have the wide ranging freedom to surf whatever you wish and that your internet service provider can't stop you from doing it. Can't slow down access to certain websites or begin charging for selective access or bundling, in much the way your tv cable is bundled. Net neutrality is a good thing. The regulations insuring it remains are a good thing. Sometimes regulating something IS a good thing even if you didn't like that a liberal government imposed it. Net neutrality maintains your freedom on the internet. Getting rid of the regulation and allowing ISP's to charge differently depending on package or slow down access to websites IS A BAD THING. The internet works perfectly under net neutrality. I would suggest you all fight very hard to insure that the current net neutrality legislation remain in place. Parsing out the internet by doing away with the current legislation is dangerously bad for democracy. There are plenty that will try to confuse this issue. I would suggest some of the Russian trolls are hard at work on it trying to persuade people to do away with this legislation. It would help them to divide the country even more than it already is. Keep the status quo. Net neutrality good. (Copied from a friend‚Äôs post...)",
